(18, 2, '2pjs3lhh30qg5gtd913fovkah3', '', 'SYMMETRY 10/10 REVERSIBLE TEXTURIZER', '', '<p>The SYMMETRY 10/10 Reversible Texturizer is a premium texturizing scissor that features 10 teeth with 10 grooves per tooth, removing approximately 60% to 70% of hair depending on the angle of the blade while cutting. The 10/10 leaves visible texture and can be used for creating traditional texture or straight textured lines in bob cuts.&nbsp;This is a reversible scissor that can be used from both sides (flipped), allowing you to cut hair differently when the teeth are pointed up or down. This scissor effortlessly slices and slide cuts through hair with zero drag or pull.</p>\r\n', '', 0, '001', NULL, NULL, NULL, NULL, NULL, NULL, 10, '664672851_2_pic_1.jpg', NULL, NULL, NULL, NULL, NULL),
(19, 8, '114b80581051c361a162e5d1fe528a8c', '', 'BOWLES Stethoscope', '', '<p>BOWLES Stethoscope With Diaphragm Flat Model Suitable Also For Anaesthesia Chest Piece</p>\r\n', '', 0, '01-115', NULL, NULL, NULL, NULL, NULL, NULL, 10, 'l_1-15.jpg', NULL, NULL, NULL, NULL, NULL),
(23, 3, 'd1f02197296d2931bb2f2b959e13b9ba', '', 'Surgical Instruemnts', '', '<ul>\r\n	<li>Most popular patterns for use in operating room</li>\r\n	<li>Lifetime warranty against cracking, pitting, rusting and breaking</li>\r\n	<li>Made in Germany</li>\r\n</ul>\r\n', '', 0, '004', NULL, NULL, NULL, NULL, NULL, NULL, 1, '139129638_3_pic_1.jpg', NULL, NULL, NULL, NULL, NULL),
(27, 1, 'rr551j6cf3nkdimos1eogpqfk7', '', 'Leather Jackets', '', 'Featuring state-of-the-art external protection technologies, the GP Tech v3 Leather Suit is constructed from premium kangaroo and bovine leather for unsurpassed abrasion and tear resistance. Fully optimized for use with or without Tech-Air&reg;, Alpinestars world leading electronic airbag safety system, the GP Tech v3 incorporates aramidic and accordion stretch panels for an anatomically profiled racing fit. The suit also features class-leading internal protection as well as reinforced stitching throughout and strategic stretch paneling for the ultimate in high performance riding comfort, security and fit. Racing leather suit designed with a body mapped race fit and pre-curved sleeves, legs and body for optimal riding performance. &bull; Tech-Air&reg; compatible; Tech-Air&reg; is the world&rsquo;s first completely electronic, self-contained, full independent upper body motorcycle airbag system with no bike-to-rider set-up configurations required. &bull; An LED display on the sleeve indicates the airbag&rsquo;s operational status, while an internal housing located in the CE-certified back protector accommodates the system vest&rsquo;s ECU. &bull;', '', 0, '002', NULL, NULL, NULL, NULL, NULL, NULL, 10, '450469970_1_pic_1.jpg', NULL, NULL, NULL, NULL, NULL),
(28, 1, 'c82afd0066d75907fd8f99d8493caab5', '', 'Leather Jackets', '', 'Featuring state-of-the-art external protection technologies, the GP Tech v3 Leather Suit is constructed from premium kangaroo and bovine leather for unsurpassed abrasion and tear resistance. Fully optimized for use with or without Tech-Air&reg;, Alpinestars world leading electronic airbag safety system, the GP Tech v3 incorporates aramidic and accordion stretch panels for an anatomically profiled racing fit. The suit also features class-leading internal protection as well as reinforced stitching throughout and strategic stretch paneling for the ultimate in high performance riding comfort, security and fit. Racing leather suit designed with a body mapped race fit and pre-curved sleeves, legs and body for optimal riding performance. &bull; Tech-Air&reg; compatible; Tech-Air&reg; is the world&rsquo;s first completely electronic, self-contained, full independent upper body motorcycle airbag system with no bike-to-rider set-up configurations required. &bull; An LED display on the sleeve indicates the airbag&rsquo;s operational status, while an internal housing located in the CE-certified back protector accommodates the system vest&rsquo;s ECU. &bull;', '', 0, '002', NULL, NULL, NULL, NULL, NULL, NULL, 10, '450469970_1_pic_1.jpg', NULL, NULL, NULL, NULL, NULL),
(29, 13, '2eb89b39b0bfed3583038701b5ec8da9', '', 'Leather Jackets', '', '<ul>\r\n	<li>Most popular patterns for use in operating room</li>\r\n	<li>Lifetime warranty against cracking, pitting, rusting and breaking</li>\r\n	<li>Made in Germany</li>\r\n</ul>\r\n', '', 0, '0012', NULL, NULL, NULL, NULL, NULL, NULL, 10, '866516113_13_pic_1.jpg', NULL, NULL, NULL, NULL, NULL),
(30, 1, 'k7ac4m0r2bhjlr2prcugl4ni11', '', 'Gloves', '', '<p>The Sparta boxing gloves are made from supple molded foam that protects you from impacts.</p>\r\n\r\n<p>The synthetic leather coating is very durable and will make your gloves last longer.</p>\r\n\r\n<p>The mesh fabric (AIR COOLING system) on the palm and thumb is very durable and breathable during fights and punch bag sessions.</p>\r\n', '', 0, '001', NULL, NULL, NULL, NULL, NULL, NULL, 10, '80993652_1_pic_1.jpg', NULL, NULL, NULL, NULL, NULL),
(31, 3, '4d8116fc8bc85afe5dc1659549907042', '', 'Gloves', '', '<p>The Sparta boxing gloves are made from supple molded foam that protects you from impacts.</p>\r\n\r\n<p>The synthetic leather coating is very durable and will make your gloves last longer.</p>\r\n\r\n<p>The mesh fabric (AIR COOLING system) on the palm and thumb is very durable and breathable during fights and punch bag sessions.</p>\r\n', '', 0, '003', NULL, NULL, NULL, NULL, NULL, NULL, 10, '773803710_3_pic_1.jpg', NULL, NULL, NULL, NULL, NULL),
