(41, 3, 'ac5cdca5fcc6976ab1e59bdd0f9b4e1b', '', 'NEUROLOGICAL HAMMER DEJERINE', '', '<h2>Hammer Dejerine with needle 21cm</h2>\r\n\r\n<p>Reliability and stability distinguish all of these classical percussion hammers for the exact testing of reflexes. From the simplest<br />\r\nmodel to the top quality buck hammer, Made in Pakistan. All hammers are supplied in a poly-bag.</p>\r\n\r\n<p>In our company you will also find the below neurological hammers:</p>\r\n\r\n<p>taylor Handle made of stainless steel, 20 cm&nbsp;<br />\r\nbuck Highest quality finish, chrome-plated, with needle and brush, 18 cm&nbsp;<br />\r\ndejerine Handle chrome-plated with needle, 21 cm&nbsp;<br />\r\nbuck Highest quality finish,with needle 21 cm&nbsp;</p>\r\n', '', 0, '01-103', NULL, NULL, NULL, NULL, NULL, NULL, 5, 'l_1-3.jpg', NULL, NULL, NULL, NULL, NULL),
