INSERT INTO `wc_contents` (`mainid`, `pname`, `pdetail`, `ptype`, `plink`, `img1`, `img_position`, `phead`, `keywords`, `description`, `pshow`, `p_position`, `ranking`, `pcurl`, `ptitle`, `pmeta`) VALUES
(1, 'Welcome', 'Our Vision, In 2000, Was To Create A Company Which Covers The Manufacturing Of Quality Surgical Instruments. We Are Proud To Have Been Able To Supply Top Quality Products, Manufactured To The Highest International Standard At Very Competitive Prices For 20 Years. rasheed Surgical Offer You A Complete Line Of Quality Instruments Designed To Meet The Requirement Of Modern Surgical Procedures. We Have A Well Equipped Production Unit With Up-To-Date Latest Manufacturing Facilities.Our Instruments Are Made From The Finest Grade Of Stainless Steel On Precision Security,', '', '', '1_page.jpg', '', '', '', '', 'Yes', '', 1, 'welcome', '', ''),
(28, 'catalouge page banner', '', '', '', '28_page.jpg', '', '', '', '', 'Yes', '', 8, 'catalouge-page-banner', '', ''),
(25, 'Factory View Banner', '', '', '', '25_page.jpg', '', '', '', '', 'Yes', '', 5, 'factory-view-banner', '', ''),
(2, 'About Us', '<p>Welcome to Rasheed Surgical, your premier destination for all things surgical! We are thrilled to introduce you to a revolutionary online shopping experience tailored exclusively for the medical community. Whether you\'re a seasoned surgeon, a dedicated healthcare professional, or an aspiring medical student, our surgical ecommerce store is designed to provide you with a comprehensive and convenient platform to access the highest quality surgical instruments, equipment, and supplies.\n\nAt [Store Name], we understand the critical role that precision and reliability play in the field of medicine. That\'s why we have meticulously curated an extensive catalog of products that meet the rigorous standards of modern surgical practice. From state-of-the-art surgical instruments to cutting-edge medical technology, our store showcases a diverse range of products sourced from trusted manufacturers and suppliers.\n\nOur user-friendly interface ensures a seamless shopping experience, allowing you to browse, compare, and select products that align with your specific needs. Whether you\'re searching for essentials like scalpels, forceps, and sutures, or seeking innovative solutions such as minimally invasive surgical tools, robotic-assisted instruments, and advanced imaging systems,Rasheed Surgical has it all.\n\nWe take pride in not only offering an exceptional selection but also in providing a platform that prioritizes affordability without compromising on quality. Our commitment to exceptional customer service means that you can rely on our team for assistance, whether you have inquiries about products, need guidance on choosing the right tools, or require support throughout the purchasing process.\n\nJoin us on the cutting edge of medical technology and innovation. Experience the future of surgical supply shopping with Rasheed Surgical as we redefine convenience, reliability, and excellence in the world of healthcare. Your journey towards precision starts here.</p>', '', '', '2_page.jpg', '', 'about-us', '', '', 'Yes', '', 2, 'about-us', '', 'about-us'),
(29, 'Contact us', '', '', '', '29_page.jpg', '', '', '', '', 'Yes', '', 9, 'contact-us', '', ''),
(14, 'Submit Inquiry', '<p>Thank you for your Inquiry! We will contact with you shortly..............!</p>\r\n', '', '', '14_page.jpg', '', '', '', '', 'Yes', '', 3, 'submit-inquiry', '', ''),
(16, 'Submit Form', '<p style=\"text-align:center\">Your Request has been Submitted.....</p>\r\n', '', '', '16_page.jpg', '', '', '', '', 'Yes', '', 4, 'submit-form', '', ''),
(30, '01-MAKE YOUR ORDER', '<p>Browse the products from your favorite category, add to your basket and make an order in a few clicks.</p>\r\n', '', '', '', '', '', '', '', 'Yes', '', 10, '01-make-your-order', '', ''),
(26, 'Basket Page banner', '', '', '', '26_page.jpg', '', '', '', '', 'Yes', '', 6, 'basket-page-banner', '', ''),
(27, 'quote page banner', '', '', '', '27_page.jpg', '', '', '', '', 'Yes', '', 7, 'quote-page-banner', '', ''),
(31, '02-PAYMENT PROCESS', '<p>Choose the most appropriative payment method. Be sure to be incognito and secure with your details.</p>\r\n', '', '', '', '', '', '', '', 'Yes', '', 11, '02-payment-process', '', ''),
(32, '03- 3-5 DAYS DELIVERY', '<p>Take advantage of our faster three-five days shipping service with quick delivery throughout the world.</p>\r\n', '', '', '', '', '', '', '', 'Yes', '', 12, '03-3-5-days-delivery', '', ''),
