(22, 239, 0, 2, 'Dejerine Neurological Hammer', '01-102', '0', '', '<p>Dejerine Neurogical Hammer 20 cm</p>\r\n', 2, 'Yes', 'l_1-2.jpg', 'l_1-2.jpg', 'l_1-2.jpg', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '2019-05-03', 0, 0, 'No', 'No', 'No', 0, 0, 0, 6, 0, 0, NULL, 0, 0, 0, 0, 'No', 'No', 0, '', 0, '200 mm', '', 0, 0, '', '', ''),
(22, 239, 0, 3, 'NEUROLOGICAL HAMMER DEJERINE', '01-103', '0', '', '<h2>Hammer Dejerine with needle 21cm</h2>\r\n\r\n<p>Reliability and stability distinguish all of these classical percussion hammers for the exact testing of reflexes. From the simplest<br />\r\nmodel to the top quality buck hammer, Made in Pakistan. All hammers are supplied in a poly-bag.</p>\r\n\r\n<p>In our company you will also find the below neurological hammers:</p>\r\n\r\n<p>taylor Handle made of stainless steel, 20 cm&nbsp;<br />\r\nbuck Highest quality finish, chrome-plated, with needle and brush, 18 cm&nbsp;<br />\r\ndejerine Handle chrome-plated with needle, 21 cm&nbsp;<br />\r\nbuck Highest quality finish,with needle 21 cm&nbsp;</p>\r\n', 3, 'Yes', 'l_1-3.jpg', 'l_1-3.jpg', 'l_1-3.jpg', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '2019-05-03', 0, 0, 'No', 'No', 'No', 0, 0, 0, 5, 0, 0, NULL, 0, 0, 0, 0, 'No', 'No', 0, '', 0, '210mm', '', 0, 0, '', '', ''),
(22, 239, 0, 4, 'NEUROLOGICAL HAMMER TAYLOR TRIANGLE', '01-104', '0', '', '<p>RUBBER TRIANGLE TAYLOR PERCUSSION HAMMER WITH CHROME HANGLE FOR NEUROLOGICAL EXAMINATION (BLACK) BEST QUALITY.</p>\r\n\r\n<p>Reliability and stability distinguish all of these classical percussion hammers for the exact testing of reflexes. From the simplest<br />\r\nmodel to the top quality buck hammer</p>\r\n', 4, 'Yes', 'l_1-4.jpg', 'l_1-4.jpg', 'l_1-4.jpg', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '2019-05-03', 0, 0, 'No', 'No', 'No', 0, 0, 0, 4, 0, 0, NULL, 0, 0, 0, 0, 'No', 'No', 0, '', 0, 'With Needle\"', '', 0, 0, '', '', ''),
(22, 239, 0, 5, 'Berliner NEUROLOGICAL Reflex Hammer', '01-105', '0', '', '<p>PERCUSSION HAMMERS BERLINER 19CM FINE QUALITY INSTRUMENTS STAINLESS STEEL,</p>\r\n\r\n<p>SPECIFICATIONS</p>\r\n\r\n<p>PRODUCT = PERCUSSION HAMMERS BERLINER</p>\r\n\r\n<p>MEASUREMENT = 19CM</p>\r\n\r\n<p>MATERIAL = STAINLESS STEEL</p>\r\n\r\n<p>FINISHING = POLISHED</p>\r\n\r\n<p>AUTOCLAVABLE</p>\r\n', 5, 'Yes', 'l_1-5.jpg', 'l_1-5.jpg', 'l_1-5.jpg', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '2019-05-03', 0, 0, 'No', 'No', 'No', 0, 0, 0, 0, 0, 0, NULL, 0, 0, 0, 0, 'No', 'No', 0, '', 0, '195 mm', '', 0, 0, '', '', ''),
(22, 239, 0, 6, ' BUCK HAMMER- NEUROLOGICAL', '01-106', '0', '', '<p>Buck Neurological Hammer. Quality neurological hammer with brush in handle and needle in head of hammer. Has a solid chrome steel handle to hold rubber heads. 8&quot; long. Contains latex in rubber tips.* This product contains natural rubber latex which may cause allergic reactions</p>\r\n', 6, 'Yes', 'l_1-6.jpg', 'l_1-6.jpg', 'l_1-6.jpg', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '2019-05-03', 0, 0, 'No', 'No', 'No', 0, 0, 0, 0, 0, 0, NULL, 0, 0, 0, 0, 'No', 'No', 0, '', 0, '200 mm', '', 0, 0, '', '', ''),
(22, 239, 0, 7, 'RABINER With Needle And Brush Diagnostic Percussion Hammer', '01-107', '0', '', '<p>RABINER With Needle And Brush&nbsp;Diagnostic Percussion Hammer<br />\r\nSize 255 mm</p>\r\n\r\n<p>Life Time Guarantee<br />\r\n100% Quality assured by Complying FDA, CE and ISO Standards from first to last step of Production</p>\r\n\r\n<p>Medical Grade Supper Quality Raw materials are used to Produce This&nbsp;hammer</p>\r\n', 7, 'Yes', 'l_1-7.jpg', 'l_1-7.jpg', 'l_1-7.jpg', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '2019-05-03', 0, 0, 'No', 'No', 'No', 0, 0, 0, 0, 0, 0, NULL, 0, 0, 0, 0, 'No', 'No', 0, '', 0, '180 mm', '', 0, 0, '', '', ''),
